body:
I think I narrowed down an issue: 
at line 78 in `components/style/parallel.rs` there is this function:
```
#[inline(never)]
fn create_thread_local_context<'scope, E, D>(
    traversal: &'scope D,
    slot: &mut Option<ThreadLocalStyleContext<E>>,
) where
    E: TElement + 'scope,
    D: DomTraversal<E>,
{
    *slot = Some(ThreadLocalStyleContext::new(traversal.shared_context()));
}
```

That function is called down here in line 130: 
```
let mut discovered_child_nodes = SmallVec::<[SendNode<E::ConcreteNode>; 128]>::new();
    {
        // Scope the borrow of the TLS so that the borrow is dropped before
        // a potential recursive call when we pass TailCall.
        let mut tlc = tls.ensure(|slot: &mut Option<ThreadLocalStyleContext<E>>| {
            create_thread_local_context(traversal, slot)
        });
```
As you can see, it both involves TLS and it seems that `slot: &mut Option<ThreadLocalStyleContext<E>>` here is borrowed twice. No idea how to fix this, though.

I'm trying to see if I can replicate the same deadlock in a test program, no success yet:
```rust
use rayon::ThreadPool;
use std::sync::mpsc::channel;
use std::sync::Arc;
use std::thread::sleep_ms;
use rand::thread_rng;
use rand::RngCore;

pub const STYLE_THREAD_STACK_SIZE_KB: usize = 256;

fn do_install(idx: u32, pool: &ThreadPool) {
    let mut i = 0;
    loop {
        println!("({}) {} installing", idx, i);
        pool.install(move || {
            let ms = thread_rng().next_u32() % 5000;
            println!("({}) Sleeping for {}ms", idx, ms);
            sleep_ms(ms);
            println!("({}) {} done", idx, i);
        });
        i += 1;
    }
}

fn main() {
    let pool = Arc::new(rayon::ThreadPoolBuilder::new()
        .num_threads(3)
        .stack_size(STYLE_THREAD_STACK_SIZE_KB * 1024)
        .build()
        .unwrap());
    let pool1 = pool.clone();
    std::thread::spawn(move || {
        do_install(0, &pool1);
    });
    do_install(1, &pool);
}
```
